import oracle.odi.mapping.generation.AbstractSyntaxTree.ASTProducerMethod;
import oracle.odi.domain.mapping.generator.KMGeneratorDelegateRegistry.GeneratorDelegateClass;
@GeneratorDelegateClass(componentType="AP", descriptionKey="GeneratorDelegateClass.LKMSqlToHBase_SQOOP")
public class LKM_SQL_to_HBase_SQOOP_Direct extends LKM_SQL_to_Hive_SQOOP {

    public LKM_SQL_to_HBase_SQOOP_Direct() {}

    public void setBinding(Binding binding) {
        super.setBinding(binding);

        def targetNode           = physicalNode.getParentNode()
        OdiDataStore targetTable = targetNode.getLogicalComponent().getBoundObject()
        def hBaseTableName       = targetTable.getResourceName()
        mBinding.setVariable( "hBaseTableName",            getQuotedString( hBaseTableName ))
    	mBinding.setVariable( "hBaseQuorum",                        '''<?=odiRef.getFlexFieldValue( odiRef.getInfo("DEST_CONNECT_GUID"), "1400", "HBASE_QUORUM" )?>''' )
    	mBinding.setVariable( "hBaseQuorumQuoted",                  '''<?=odiRef.getQuotedString( odiRef.getFlexFieldValue( odiRef.getInfo("DEST_CONNECT_GUID"), "1400", "HBASE_QUORUM" ) )?>''' )
        mBinding.setVariable( "option_CREATE_TARG_TABLE",  isOptionTrue( "CREATE_TARG_TABLE" ) )

        // Are all columns part of the same column family?
        def hBaseColumnFamily = null;
        targetNode.getNodeAttributes().each { attr -> def colName = attr.getName()
                                                      // Fetch and verify the columnFamily
                                                      // Does the column name have a colFam/colName separator?
                                                      if ( colName.contains(":") ) {
                                                          def colFam = colName.substring(0, colName.indexOf(":"));
                                                          // Is this the first column? 
                                                          if ( hBaseColumnFamily == null) {
                                                              hBaseColumnFamily = colFam;
                                                          } else if ( !hBaseColumnFamily.equals( colFam ) ) {
                                                              throw new OdiKMException(
                                                                  "ODIKM-HADOOP-IKM-10000", 
                                                                  "ODIKM-HADOOP-IKM-10000: Columns from different column families mapped. This is not supported by SQOOP.", 
                                                                  null );
                                                          }
                                                      } // No separator. Then it should be the table's key column.
                                                      else if ( !colName.equals("key") ) {
                                                          throw new OdiKMException(
                                                              "ODIKM-HADOOP-IKM-10000", 
                                                              "ODIKM-HADOOP-IKM-10000: Unsupported column name: {0}.", 
                                                              [ colName ] as String[] );
                                                      }                                                          
                                             }

        /*
        // Find source alias, which is mapped into the HBase row key
        def hBaseRowKey = null
        def hBaseRowKeyAttr = targetNode.getNodeAttributes().find { attr -> attr.getName().equals("key") }
        if ( hBaseRowKeyAttr == null || 
            (hBaseRowKeyAttr?.getExpressions().size() < 1) ||
            (hBaseRowKeyAttr?.getExpressions()[0].getReferencedObjects().size() < 1) 
           )
            throw new OdiKMException(
                "ODIKM-HADOOP-IKM-10000", "ODIKM-HADOOP-IKM-10000: Target column key is not mapped.", 
                null );   
        def srcAttr = hBaseRowKeyAttr?.getExpressions()[0].getReferencedObjects()[0]
        hBaseRowKey = srcAttr.getSQLAliasName()
        */
        def hBaseRowKey = "key"

        mBinding.setVariable( "hBaseColumnFamily",  hBaseColumnFamily )
        mBinding.setVariable( "hBaseRowKey",  hBaseRowKey )
    }

    void updateBinding() {            
        // No need for a Hive staging table to be created:
        stgTableAST = null
        // No need for a Hive session setup
        prepareHiveSession = false

        super.updateBinding()
    }
} // End of class definition
